INSERT INTO `oc_information_description` VALUES (4,1,'Контакты1','&lt;p&gt;&lt;br&gt;&lt;/p&gt;\r\n','','','',''),(5,1,'Сотрудничество','&lt;div style=&quot;text-align: center; color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;ВНИМАНИЕ!&amp;nbsp;&lt;span style=&quot;text-decoration: underline;&quot;&gt;Подтверждение зарегистрированных аккаунтов, обработка заказов и электронных писем происходит с 9:00 до 18:00 с понедельника по пятницу в соответствии с графиком работы нашего офиса.&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center; color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;span style=&quot;text-decoration: underline;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center; color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;Если Вы хотите видеть нашу продукцию в своем магазине, пожалуйста свяжитесь с нами по почте order@polkadot.su с пометкой «опт».&amp;nbsp;&lt;/div&gt;&lt;p&gt;&lt;/p&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;Если Вы являетесь представителем оптовой компании и хотите приобрести продукцию «Polkadot», пожалуйста свяжитесь с нами по почте order@polkadot.su с пометкой «крупный опт».&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;Если Вы хотите предложить другие виды сотрудничества, пожалуйста свяжитесь с нами по почте info@polkadot.su, используя пометку, соответствующую тематике письма.&lt;/div&gt;&lt;/span&gt;&lt;p&gt;&lt;/p&gt;&lt;div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;Наш менеджер свяжется с Вами в кратчайшие сроки!&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;\r\n','','','',''),(6,1,'Оплата/Доставка','&lt;div&gt;&lt;div style=&quot;text-align: right; color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;ВНИМАНИЕ! &lt;span style=&quot;text-decoration: underline;&quot;&gt;Подтверждение зарегистрированных аккаунтов, обработка заказов и электронных писем происходит с 9:00 до 18:00 с понедельника по пятницу в соответствии с графиком работы нашего офиса.&lt;/span&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Регистрация на сайте (для оптовых клиентов)&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;Для того, чтобы увидеть оптовые цены, а также продукцию, которая доступна только для оптовых клиентов, пройдите пожалуйста регистрацию на сайте. После того, как наш менеджер подтвердит Ваш аккаунт, Вы получите доступ в личный кабинет и сможете оформлять оптовые заказы на сайте.&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; text-align: center; font-size: 13px;&quot;&gt;&lt;strong&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Оплата&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-decoration: underline;&quot;&gt;Опт:&lt;/span&gt;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;color: rgb(102, 102, 102); font-family: \'Open Sans\', sans-serif; font-size: 12px;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Оплата оптовых заказов производится по безналичному расчету.&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-decoration: underline;&quot;&gt;Розница:&lt;/span&gt;&amp;nbsp;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• В нашем интернет-магазине нет минимальной суммы заказа.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Вы можете оплатить заказ онлайн банковской картой при оформлении, сделать перевод на карту Сбербанка или Qiwi-кошелек.&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 14px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;Сборка заказов&lt;/strong&gt;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• &amp;nbsp;Сборка оптовых заказов осуществляется в течение 3-7 рабочих дней после поступления денежных средств на расчетный счет. В момент выхода новых коллекций срок сборки может увеличится до 14 рабочих дней.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• &amp;nbsp;Сборка розничных заказов осуществляется в течение 2-3 рабочих дней после поступления оплаты. Затем заказ отправляется к Вам в ближайший вторник/пятницу. В момент выхода новых коллекций срок сборки может увеличится до 3-5 рабочих дней.&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 14px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;strong&gt;Доставка&lt;/strong&gt;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-decoration: underline;&quot;&gt;Отправка оптовых заказов:&lt;/span&gt;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;color: rgb(102, 102, 102); font-family: \'Open Sans\', sans-serif; font-size: 12px;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Доставка оптовых заказов по СПб в пределах КАД осуществляется бесплатно.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Стоимость доставки за пределы КАД рассчитывается индивидуально.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• В другие города РФ доставка осуществляется ТК «Деловые линии», Почтой России, ЕМС и иными компаниями.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Стоимость доставки до любой удобной для клиента ТК - бесплатно, доставка &amp;nbsp;Почтой России рассчитывается индивидуально.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Доставка в ТК (или отправка почтой) осуществляется в ближайший вторник/пятницу с момента оплаты заказа. Оплата доставки осуществляется в ТК при получении заказа.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;text-align: start;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Мы можем отвезти Ваш заказ в любую удобную для Вас ТК, для этого сообщите нам пожалуйста адрес сайта ТК, время работы, адреса приема грузов в СПб.&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;br&gt;&lt;/div&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;text-decoration: underline;&quot;&gt;Для розничных покупателей:&lt;/span&gt;&lt;/div&gt;&lt;/span&gt;&lt;div style=&quot;text-align: center;&quot;&gt;&lt;span style=&quot;font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/div&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Мы отправляем заказы Почтой РФ после полной предоплаты заказа и стоимости доставки. Стоимость доставки почтой РФ - 180 рублей; доставка 1 классом почтой РФ - 360 рублей.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Доставка Почтой по РФ осуществляется бесплатно при заказе от 4\'000 руб.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Стоимость отправки посылок почтой РФ по миру - рассчитывается индивидуально по весу.&lt;/div&gt;&lt;/span&gt;&lt;span style=&quot;color: rgb(94, 94, 94); font-family: sans-serif, Arial, Verdana, \'Trebuchet MS\'; font-size: 13px;&quot;&gt;&lt;div style=&quot;text-align: center;&quot;&gt;• Отправка посылок осуществляется каждую неделю во вторник и пятницу. Обращаем Ваше внимание на то, что заказ попадает на сборку только после оплаты. Сборка заказа занимает 2-3 рабочих дня в зависимости от общей очереди заказов. После сборки Ваш заказ отправляется в ближайший вторник/пятницу.&lt;/div&gt;&lt;/span&gt;&lt;/div&gt;\r\n','','','',''),(3,1,'Где купить?','&lt;p&gt;&lt;/p&gt;&lt;h3&gt;&lt;/h3&gt;&lt;p style=&quot;color: rgb(94, 94, 94); font-family: Verdana; font-size: 12px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;Продукцию «Polkadot» можно приобрести в следующих розничных магазинах:&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;color: rgb(94, 94, 94); font-family: Verdana; font-size: 12px;&quot;&gt;&lt;span style=&quot;font-weight: bold;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/p&gt;&lt;div clas